import React from "react";

const styles = {
  right: {
    backgroundColor: "white",
    height: "100%",
    width: "50%",
    marginLeft: "50%",
  },
  container: {
    marginLeft: "30px",
    marginTop: "30px",
  },
  p: {
    display: "block",
    marginBottom: "10px",
    textDecoration: "none",
    color: "black",
    fontSize: "20px",
  },
};

function Alex({
  handleAboutClick,
  handleContactClick,
  handleWorksClick,
  handleAlexClick,
}) {
  return (
    <div style={styles.left}>
      <div style={styles.container}>
        <p
          className="header-options"
          onClick={handleAlexClick}
          style={styles.p}
        >
          ALEX SCHER
        </p>
        <p
          className="header-options"
          style={styles.p}
          onClick={handleAboutClick}
        >
          ABOUT
        </p>
        <p
          className="header-options"
          style={styles.p}
          onClick={handleWorksClick}
        >
          WORKS
        </p>
        <p
          className="header-options"
          style={styles.p}
          onClick={handleContactClick}
        >
          CONTACT
        </p>
      </div>
    </div>
  );
}

export default Alex;
